    <body>
        <script>
            class Queue {
                constructor(in_items){
                    this.items=in_items || [];
                }
                length(){
                    return this.items.length;
                }
                enqueue(el)
                {
                    this.items.push.el;
                }
                dequeue(){
                    return this.length() > 0 ?this.items.shift() : undefined;
                }
            }
        </script>
    </body>
